import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Home = () => {
  const navigate = useNavigate();
  const token = localStorage.getItem('token');

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  return (
    <div>
      <h1>QuizMaker - By AspireNex</h1>
      <nav>
        {token ? (
          <>
            <button onClick={handleLogout}>Logout</button>
            <button onClick={() => navigate('/create-quiz')}>Create Quiz</button>
          </>
        ) : (
          <>
            <Link to="/login">Login</Link>
            <Link to="/register">Register</Link>
          </>
        )}
      </nav>
      <div>
        <h2>Genres:</h2>
        <ul>
          <li><Link to="/quizzes/Science">Science</Link></li>
          <li><Link to="/quizzes/Math">Math</Link></li>
          <li><Link to="/quizzes/History">History</Link></li>
        </ul>
      </div>
    </div>
  );
};

export default Home;
